import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click the cart icon
    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.click('.cart');

    // Wait for cart modal to appear
    await page.waitForSelector('#cartModal[style*="display: block"]', { timeout: 5000 });

    // Take screenshot of opened cart modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_modal_open.png'));

    // Extract cart data
    const extractedData = {};

    // Check if cart is empty
    const emptyCart = await page.$('.empty-cart');
    if (emptyCart) {
      extractedData.isEmpty = true;
      extractedData.message = await page.$eval('.empty-cart', el => el.textContent.trim());
    } else {
      extractedData.isEmpty = false;
      extractedData.itemCount = await page.$$eval('.cart-item', items => items.length);
      extractedData.total = await page.$eval('#cartTotal', el => el.textContent.trim());
    }

    return {
      success: true,
      action: "Successfully opened shopping cart modal",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to open shopping cart modal",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
